import React, { useEffect, useState, useContext } from 'react';
import { makeStyles } from '@material-ui/core/styles';
import { Grid } from '@material-ui/core';
import Table from '@material-ui/core/Table';
import TableBody from '@material-ui/core/TableBody';
import TableCell from '@material-ui/core/TableCell';
import TableContainer from '@material-ui/core/TableContainer';
import TableHead from '@material-ui/core/TableHead';
import TableRow from '@material-ui/core/TableRow';
import Paper from '@material-ui/core/Paper';
import Container from '@material-ui/core/Container';
import { useTranslation } from 'react-i18next';
import { MedContext } from '../internalMedContext';

const useStyles = makeStyles((theme) => ({
    table: {
      minWidth: 650,
    },
    paper: {
        padding: theme.spacing(2),
        textAlign: 'center',
        color: 'black',
        marginBottom: 10,
    },
  }));

  function createData(name, calories, fat, carbs, protein) {
    return { name, calories, fat, carbs, protein };
  }



const ViewInternalMed = () => {
    const { t, i18n } = useTranslation();
    const classes = useStyles();
    const [values, setValues] = useContext(MedContext);

    const rows = [
        createData('name', values.name,),
        createData('Date Of Birth', values.DateOfBirth.toLocaleDateString() ),
        createData('Height', values.height ),
        createData('Weight', values.weight),
        createData('Sex', values.sex),


        createData('Problemtoday', values.problemtoday),
        createData('Problemtoday', values.problemtoday),
      ];

      const rows1 = [
        createData('Food allergis', values.allergis.foods),
        createData('Medcine allergis', values.allergis.medcine),
      ];

      const rows2 = [
        createData('stools', values.stools),
        createData('stoolfrequency', values.stoolfrequency),
      ]

    return (
        <div>
            <Container component="main" maxWidth="lg">
            <Grid item xs={12}>
                    <Paper className={classes.paper}><strong><h4>{t('internalMedcine.PersonnalInformation')}</h4></strong></Paper>
                </Grid>

             <TableContainer component={Paper}>
      <Table className={classes.table} aria-label="simple table">

        <TableBody>
          {rows.map((row) => (
            <TableRow key={row.name}>
              <TableCell component="th" scope="row">
                {row.name}
              </TableCell>


            </TableRow>
          ))}
        </TableBody>
      </Table>
    </TableContainer>

    <Grid item xs={12}>
                <Paper className={classes.paper}><strong><h4>{t('internalMedcine.Allergie')} /アレルギー</h4></strong></Paper>
            </Grid>
            <TableContainer component={Paper}>
      <Table className={classes.table} aria-label="simple table">

        <TableBody>
          {rows1.map((row) => (
            <TableRow key={row.name}>
              <TableCell component="th" scope="row">
                {row.name}
              </TableCell>

            </TableRow>
          ))}
        </TableBody>
      </Table>
    </TableContainer>
    </Container>
        </div>
    )
}
export default ViewInternalMed;
